import React, { useState } from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import ButtonGroup from '@mui/material/ButtonGroup';
import { useNavigate } from "react-router-dom";

const AddUser = () => {
  const [state, setState] = useState({
    id: "",
    name: "",
    email: "",
    gender: "",
    status: ""
  });

  let navigate = useNavigate();

  const { id, name, email, gender, status } = state;
  return (
    <div>
      <h2>Add New User</h2>
      <Box
        component="form"
        sx={{
          marginTop: 5,
          '& > :not(style)': { m: 1, width: '25ch' },
        }}
        noValidate
        autoComplete="off"
      >
        <TextField id="outlined-size-small" label="ID" variant="outlined" value={id} type="number"/>
        <br />
        <TextField id="outlined-size-small" label="Name" variant="outlined" value={name} type="text"/>
        <br />
        <TextField id="outlined-size-small" label="Email" variant="outlined" value={email} type="email"/>
        <br />
        <TextField id="outlined-size-small" label="Gender" variant="outlined" value={gender} type="text"/>
        <br />
        <TextField id="outlined-size-small" label="Status" variant="outlined" value={status} type="text"/>
        <br />
        <ButtonGroup variant="contained" size="small" aria-label="text button group">
          <Button color="primary" onClick={() => navigate('/')}>Cancel</Button>
          <Button style={{ marginLeft: '20px' }} color="primary" type="submit">Submit</Button>
        </ButtonGroup>
      </Box>
    </div>
  )
}

export default AddUser;
